PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "ANP" (
                                FIELD TEXT,            
                                BASIN TEXT,
                                STATE TEXT,            
                                OPERATOR TEXT,
                                CONTRACT_NUMBER TEXT,
                                OIL_PRODUCTION REAL,
                                GAS_PRODUCTION REAL,
                                MONTH INTEGER,
                                YEAR INTEGER);

CREATE TABLE IF NOT EXISTS "NLIDB_SQL_FROM_NLQ" (
	"NLQ"	TEXT NOT NULL UNIQUE,
	"SQL"	TEXT NOT NULL
);
CREATE VIEW NLIDB_RESULT_SET as select * from ANP;
COMMIT;
